import { LocalizationKey } from "../keys";

export const vi = {
  [LocalizationKey.WELCOME]: "Xin chào",
  [LocalizationKey.HOME]: "Trang chủ",
  [LocalizationKey.START]: "Bắt đầu",
  [LocalizationKey.LOADING]: "Đang tải",
};
